import React, {useState, useEffect} from 'react';
import axios from './axios';


const Movie = (props) => {
    const [movies, setMovies] = useState([]);

    const fetchMovies = async () => {
        const request = await axios.get(props.url)
        .then((response) => {
            console.log(response)
        })
    }

    useEffect(() => {
        fetchMovies();
    }, [])

    return (
        <div>
            <h2>{props.title}</h2>
            
        </div>
    )
}

export default Movie;
